import React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from "./components/Navbar";
import ImgList from "./components/pages/ImgList";

function App() {
  return (
    <div>

        <Navbar />
        <Routes>
          <Route path='/' exact />
        </Routes>

    </div>
  );
}

export default App;
